-- ----------------------------
-- Table structure for aliyun_market_record
-- ----------------------------
DROP TABLE IF EXISTS `aliyun_market_record`;
CREATE TABLE `aliyun_market_record` (
  `instance_id` varchar(255) NOT NULL,
  `ali_uid` varchar(255) NOT NULL COMMENT '客户唯一标识',
  `action` varchar(255) DEFAULT NULL,
  `order_biz_id` varchar(255) DEFAULT NULL COMMENT '云市场业务 ID',
  `order_id` varchar(255) DEFAULT NULL COMMENT '云市场订单 云市场订单 ID',
  `sku_id` varchar(255) DEFAULT NULL COMMENT '商品规格标识，与商品唯一对应，可在商品管理 的销售信息中查看。',
  `expired_on` varchar(255) DEFAULT NULL COMMENT '过期时间(yyyy-MM-dd HH:mm:ss)',
  `account_quantity` int(11) DEFAULT NULL COMMENT '帐号数量，适用于以帐号数量形式售卖的商品',
  `template` varchar(255) DEFAULT NULL COMMENT '模板 ID，适用于模板类建站商品',
  `corp_id` int(11) DEFAULT NULL COMMENT '钉钉企业 ID，适用于钉钉类商品',
  `email` varchar(255) DEFAULT NULL,
  `mobile` varchar(255) DEFAULT NULL,
  `domains` varchar(255) DEFAULT NULL COMMENT '以逗号隔开的域名字符串',
  `create_time` bigint(20) DEFAULT NULL COMMENT '阿里云订阅创建时间',
  PRIMARY KEY (`instance_id`),
  KEY `sku_id` (`sku_id`) USING BTREE,
  KEY `email` (`email`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

